import './App.css';

const App = () => {
  const isUserLoggedIn = null;



  return (
    <div className="App">
    <h1>Hello, {2 + 2}</h1>
    {isUserLoggedIn ? (
      <>
      <h1>You're logged in, great.</h1>
      </>
    ) : (
      <>
      <button>Click here to log in</button>
      </>
    )}

    </div>
  );
}

export default App;
